oll(1);\"><a>&lt</a></td>"+  "<td valign=top id=tdScroll class=\"clScroll2\" onclick=\"parent.fnScrollTabs(1);\" ondblclick=\"parent.fnScrollTabs(1);\" onmouseover=\"parent.fnMouseOverScroll(2);\" onmouseout=\"parent.fnMouseOutScroll(2);\"><a>&gt</a></td>"+  "<td valign=top id=tdScroll class=\"clScroll\" onclick=\"parent.fnFastScrollTabs(1);\" onmouseover=\"parent.fnMouseOverScroll(3);\" onmouseout=\"parent.fnMouseOutScroll(3);\"><a>&#187;</a></td>"+  "<td style=\"font:1pt\">&nbsp;<td></tr></table></body></html>";frames['frScroll'].document.open("text/html","replace");frames['frScroll'].document.write(szHTML);frames['frScroll'].document.close(); szHTML =  "<html><head>"+  "<style>A:link,A:visited,A:active {text-decoration:none;"+"color:"+c_rgszClr[3]+";}"+  ".clTab {cursor:hand;background:"+c_rgszClr[1]+";font:8pt Arial;padding-left:3px;padding-right:3px;text-align:center;}"+  ".clBorder {background:"+c_rgszClr[2]+";font:1pt;}"+  "</style></head><body onload=\"parent.fnInit();\" onselectstart=\"event.returnValue=false;\" ondragstart=\"event.returnValue=false;\" bgcolor="+c_rgszClr[4]+  " topmargin=0 leftmargin=0><table id=tbTabs cellpadding=0 cellspacing=0>"; var iCellCount=(c_lTabs+1)*2; var i; for (i=0;i<iCellCount;i+=2)  szHTML+="<col width=1><col>"; var iRow; for (iRow=0;iRow<6;iRow++) {  szHTML+="<tr>";  if (iRow==5)   szHTML+="<td colspan="+iCellCount+"></td>";  else {   if (iRow==0) {    for(i=0;i<iCellCount;i++)     szHTML+="<td height=1 class=\"clBorder\"></td>";   } else if (iRow==1) {    for(i=0;i<c_lTabs;i++) {     szHTML+="<td height=1 nowrap class=\"clBorder\">&nbsp;</td>";     szHTML+=      "<td id=tdTab height=1 nowrap class=\"clTab\" onmouseover=\"parent.fnMouseOverTab("+i+");\" onmouseout=\"parent.fnMouseOutTab("+i+");\">"+      "<a href=\""+document.all.item("shLink")[i].href+"\" target=\"frSheet\" id=aTab>&nbsp;"+c_rgszSh[i]+"&nbsp;</a></td>";    }    szHTML+="<td id=tdTab height=1 nowrap class=\"clBorder\
